Build a Rust program that calculates the sum of all even integers between two given numbers. The program should take two integers as input and output the sum of all even integers between them.

Solution:
```rust
fn main() {
    let mut sum = 0;

    for i in 1..10 {
        if i % 2 == 0 {
            sum += i;
        }
    }

    println!("{}", sum);
}
```


Explanation:
The program uses a for loop to iterate over the range of numbers from 1 to 10. For each number, it checks if the number is even by checking if its remainder when divided by 2 is 0. If the number is even, it adds it
